import Header from "./components/Layout/Header"
import SearchBox from "./components/Product/SearchBox";

function App() {
  const inputSearchHandler = (event) => {
    return event.target.value;
  };

  return (

    <main>
      <Header/>
      <SearchBox inputSearch={inputSearchHandler}/>
      <Products/>
    </main>
  );
}

export default App;
